export default function About() {
  return (
    <section id="about" className="p-8 bg-dark">
      <h2 className="text-2xl font-semibold mb-4">About Me</h2>
      <p className="text-gray-400 max-w-2xl">
      Hello, I am a freshman at The University of Houston studying Computer Engineering. I have a strong drive for anything tech-related, constantly seeking to innovate and improve my skills in cybersecurity, web development, and hardware engineering. I excel in collaborative environments, leveraging my ability to communicate effectively and excel with diverse teams. My proactive approach and dedication to continuous learning makes me a valuable asset in any tech-focused project.      </p>
    </section>
  );
}
